import React from 'react';
import TimeAgo from 'timeago-react';

const Grid = (props) => {
    return(
      <div className={props.className}>
          <article className="container" className={props.className}>
          <div className="title">{props.titleA}</div>
          <img className="gridImg" src={props.storyA} alt="News-Story-Left" />
          <TimeAgo className="timeStamp" datetime={props.time} />
          <div className="btn-container"><button className=""></button></div>
          </article>
      </div>
    );
}

export default Grid;
